	public static Optional<String> getExpected(int n) {
		if (n < expecteds.length) {
			return Optional.of(expecteds[n]);
		} else {
			return Optional.empty();
		}
	}

	public static Optional<Icon> getExpectedIcon(int n) {
		URL url = Dragons.class.getResource(String.format("images/dragon_%02d.png", n));
		if (n < expecteds.length) {
			return Optional.of(new ImageIcon(url));
		} else {
			return Optional.empty();
		}
	}

	private static class Point2 {
		final double x;
		final double y;

		public Point2(double x, double y) {
			this.x = x;
			this.y = y;
		}
	}

	// modified from unknown author
	public static void drawDragon(String curve) {
		double segLength = 1.0;
		// start to the right
		int xVec = 1;
		int yVec = 0;
		// start at coordinate 0, 0
		double x = 0;
		double y = 0;

		double xMin = x;
		double xMax = x;
		double yMin = y;
		double yMax = y;

		List<Point2> points = new LinkedList<>();
		for (char c : curve.toCharArray()) {
			if (c == 'F' || c == 'H') { // draw a line
				double newX = x + segLength * xVec;
				double newY = y + segLength * yVec;
				x = newX;
				y = newY;
				points.add(new Point2(x, y));
			} else if (c == '+') { // turn left
				int temp = xVec;
				xVec = yVec;
				yVec = -temp;
			} else if (c == '-') { // turn right
				int temp = xVec;
				xVec = -yVec;
				yVec = temp;
			}
			xMin = Math.min(xMin, x);
			xMax = Math.max(xMax, x);
			yMin = Math.min(yMin, y);
			yMax = Math.max(yMax, y);
		}
		double border = segLength;

		StdDraw.enableDoubleBuffering();
		StdDraw.clear();
		StdDraw.setXscale(xMin - border, xMax + border);
		StdDraw.setYscale(yMin - border, yMax + border);
		x = 0;
		y = 0;
		for (Point2 point : points) {
			StdDraw.line(x, y, point.x, point.y);
			x = point.x;
			y = point.y;
		}
		StdDraw.show();
	}
